YUI.add("autocomplete-highlighters-accentfold",function(c){var a=c.Highlight,b=c.Array;c.mix(c.namespace("AutoCompleteHighlighters"),{charMatchFold:function(f,e){var d=b.unique(f.split(""));return b.map(e,function(g){return a.allFold(g,d);});},phraseMatchFold:function(e,d){return b.map(d,function(f){return a.allFold(f,[e]);});},startsWithFold:function(e,d){return b.map(d,function(f){return a.allFold(f,[e],{startsWith:true});});},wordMatchFold:function(e,d){return b.map(d,function(f){return a.wordsFold(f,e);});}});},"@VERSION@",{requires:["array-extras","highlight-accentfold"]});